import React from 'react';
import { Row,Col,Container,Button,Form } from "react-bootstrap";
import "./Contacts.css"

const Contacts = () => {
    return (
        <div>
            <Container fluid>
            <Row >
                <Col className='d-flex ' >
                <Col>
                <h3>Contacts</h3>
                <Button>create</Button>
                </Col>
                <Col>
                <Form.Control size="sm" type="text" placeholder="Small text" />
                </Col>
                </Col>
                <Col>
                </Col>
            </Row>
            </Container>
            
        </div>
    );
}

export default Contacts;
